import "./App.css";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1 className="title">seunchoi's website</h1>
        <p>
          <button className="btn">Wordpress Blog</button>
        </p>
        <button className="btn">Adminer</button>
      </header>
    </div>
  );
}

export default App;
